import React, { useEffect, useState } from "react";

const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(()=>{
    fetch('https://jsonplaceholder.typicode.com/todos/1').then((data)=>{
        data.json().then(result => {
            console.log("result",result)
            setUser(result.data)
            setUser(result.data) 
        })
    })

  },[])
  return (
    <>

    {
        user.map((item,index )=>{
           <tr>
            <td>{item.id}</td>
            <td></td>
            <td></td>
            <td></td>
           </tr>

        })
    }


    </>
  );
};

export default Api;
